import React from "react";
import AppLayout from "../components/AppLayout";
import { Button, Calendar, Col, Row } from 'antd';
import MyInfo from "../components/myInfo";
import './css/profile.module.css';
import Mention from "../components/mention";
import LikeList from "../components/likeList";
import Followers from "../components/followers";
import Followings from "../components/followings";
import Card from "antd/lib/card/Card";
import Login from "./login";
import { useSelector } from "react-redux";
import Link from "next/link";
import { LOAD_POST_REQUEST } from "../reducers/post";
import wrapper from '../store/configureStore';
import useSWR from "swr";
import DateCellRender from "../util/dateCellRender";
import styled from "styled-components";

const OneProfile = styled.div`

    .div1{
        position: relative;
        width: 1250px;
    }
    .div2{
        float: left;
    }
    .section1{
        margin-top: 50px;
    }
    .button1{
        background-color: black;
        color: white;
    }
    .cal1{
        width: 700px;
        height: 920px;
    }
`;


const Profile = () => {

 return(
    <OneProfile>
    <div className="div1">
       <section className="section1">
           <Row><h1>MY Profile</h1></Row>
           <Row><Button href="/newLook" className="button1">오늘의 데일리룩 만들기</Button></Row>
       <Row>
       <div className="div2">
        <Card>
            <Calendar 
            id='cal'
            className="cal1"
            style={{}}
            dateCellRender={DateCellRender}
            />

        </Card>
       </div>
       <div style={{float: 'left'}}>
       <MyInfo /> 
        <Mention />
        <LikeList />
       </div>
       </Row>
       <Row style={{marginTop: 15}}>
           
           <Followers  />
           <Followings  />   
       </Row>  
       </section>
       </div>
       </OneProfile>

 );
};

export default Profile;
